import React, {useRef, Suspense,  useEffect, useState} from 'react'
import { extend } from 'react-three-fiber'
import { useFrame } from 'react-three-fiber'
import house from '../../textures/models/small-house/house1.glb'
import { GLTFLoader } from 'three/examples/jsm/loaders/GLTFLoader'
import {useLoader } from 'react-three-fiber';
import * as THREE from "three";

const Houses = (props) => {

var houses = [];

for (let i = 0; i<props.houses; i++) {

    let position = props.houses[i].position;
    const gltf = useLoader(GLTFLoader, house)
    houses.push(<primitive object={gltf.scene} scale={[0.2,0.2,0.2]} position={position} />)

}

    return (
        <>
          {houses}  
        </>
    )
}

export default Houses
